INSERT INTO public.beta_feedback (id, user_id, email, motivation, report_clarity, most_helpful_feature, frustrations, perceived_accuracy, missing_feature, pmf_disappointment, pmf_substitute, pmf_core_value, pmf_willing_to_pay, pmf_price_expectation, wants_session, created_at) VALUES ('efc7630d-8b54-4ad9-8d20-22a011e22864', '8e6ca83d-b7e8-4d46-8af0-e2910676210a', 'ladygist1@gmail.com', 'It''s very helpful to determine what products to buy and what products are not good for you.', 'Very Easy', 'Explaining the ingredients was helpful.', 'You have to follow the directions.', 'Much more accurate than I expected', 'Comparing the product that I uploaded with another product.', 'I didn''t use it enough to care', 'I don''t know what to use. This is great. It''s different and it''s worth it.', 'It solves a lot because you will know what is good for you and what''s not.', 'Yes', '$5–10', true, '2025-11-29 20:03:07.383376+00') ON CONFLICT DO NOTHING;
INSERT INTO public.beta_feedback (id, user_id, email, motivation, report_clarity, most_helpful_feature, frustrations, perceived_accuracy, missing_feature, pmf_disappointment, pmf_substitute, pmf_core_value, pmf_willing_to_pay, pmf_price_expectation, wants_session, created_at) VALUES ('8b791d4b-d1e3-45d2-9986-d6907ac0c9eb', 'ed1ca66f-4cf0-4d6f-8db4-87012cbc3ddf', 'kharris488@gmail.com', 'A desire for a non-toxic lifestyle, while supporting black owned business', 'Very Easy', 'The EpiQ score breakdown - made it simple to understand which components of the product scored highest vs. the components that drove the score down', 'I just wish there was a button like, "Scan another product" at the bottom of the results page.', 'A little less accurate than I expected', 'The ability to look up products by name.', 'Somewhat disappointed', 'Google', 'Reconfirmation that I''m using the right products', 'Maybe', '$3–5', true, '2025-11-30 13:21:27.027125+00') ON CONFLICT DO NOTHING;
INSERT INTO public.beta_feedback (id, user_id, email, motivation, report_clarity, most_helpful_feature, frustrations, perceived_accuracy, missing_feature, pmf_disappointment, pmf_substitute, pmf_core_value, pmf_willing_to_pay, pmf_price_expectation, wants_session, created_at) VALUES ('37c4f44a-9e5b-4399-b271-6b366a028618', 'bbe9a7bf-cbd3-4dce-84c7-e2a9782af92a', 'ssuziesuarez@gmail.com', 'If certain enhancements are made I would definitely use this app.', 'A little Easy', 'Importing a photo of the product', 'Please enable the password reset option and allow scanning the products.', 'Much more accurate than I expected', 'Scanning the products and maybe more granular categories.', 'Somewhat disappointed', 'Would just rely on my own research', 'Feedback on existing products and recommendations for alternatives or savings.', 'Maybe', '$3–5', true, '2025-11-30 17:48:04.046634+00') ON CONFLICT DO NOTHING;
